import "./App.css";
import Navpar from "./components/Navpar";
import Home from "./components/Home";
import About from "./components/About";
import { TailWind } from "./components/TailWind";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
function App() {
  return (
    <div className=" bg-gradient-to-r from-slate-900 via-slate-800 to-slate-700 ">
      <div className=" flex flex-col md:flex-row  ">
        <div className=" bg-slate-100 mx-1 text">One</div>
        <div className=" bg-slate-100 mx-1 text">Tow</div>
        <div className=" bg-slate-100 mx-1 text">Three</div>
        <div className=" bg-slate-100 mx-1 text">Four</div>
        <div className=" bg-slate-100 mx-1 text">Sex</div>
      </div>
      <Router>
        <Navpar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/tail" element={<TailWind />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
